12293.desc:
Ce kit de musiques remplace toutes les musiques du jeu, et peut être utilisé par les personnes avec qui vous jouez. Il comprend également une musique spéciale de MJ que tout le monde entend quand vous êtes MJ lors d'une manche.

Le kit de musiques remplace les musiques suivantes :
- menu principal ;
- début et fin de manche ;
- objectif de carte ;
- avertissement des dix secondes avant explosion ;
- caméra de poursuite post-mortem.
